import React, { Component } from 'react';
import { NavLink } 			from 'react-router-dom';
import { Head5 } 			from '../styles/Head5'
import Title				from '../components/Title';
import { FaLaptopCode, FaPaintBrush, FaDatabase} from 'react-icons/fa'

import { followData } from "../data/followData";
import { CrNv } 			from '../styles/CrNv';

export default class Follow_Icon extends Component {

	state = {
		follows: followData
	};

	render() {
	    return (

	      <section> 	        
	        <div className="nav-project"></div>	        
		          <div className="container">
		           <div className="row">
		          	<div className="col-10 mx-auto col-md-6 mt-2"> 
		          	<div className='moda-foot'>

		                <ul className="nav-icons">
		            	  {this.state.follows.map((item, index) => {
		              		return (

		              		  <li key={index} className="nav-item m mr-5">

								<a className="nav-link" href={item.source_url} 
				    			   target="_blank" rel={item.rel}> {item.name}                          
		                        </a>     		  	
		              			<h6 className="nav-link">{item.title}</h6>

		              		  </li>

		              		);
		            	  })}
		                </ul>

				    </div>
				    </div>
				  </div> 
				 </div>
	      </section>

		);
  	}
}
